import React from 'react';
import {
  View,
  Text,
  TouchableOpacity,
  StyleSheet,
  Dimensions,
  Platform
} from 'react-native';
import { useNavigate } from 'react-router-dom';

const { width } = Dimensions.get('window');

const ServicesSection = () => {
  const navigate = useNavigate();

  const handleCTAPress = () => {
    navigate('/book');
  };

  const services = [
    {
      title: 'Discovery Call',
      price: 'Free',
      duration: '30 minutes',
      description: "Let's see if we're a fit. I'll be honest about your idea's potential.",
      features: [
        'Candid assessment of your idea',
        'Market opportunity evaluation',
        'Technical feasibility check',
        'Go/No-go initial recommendation'
      ],
      cta: 'Book Reality Check',
      highlighted: false
    },
    {
      title: 'Validation Sprint',
      price: '$5,000',
      duration: '3 weeks',
      description: 'Deep dive into market validation before we build anything.',
      features: [
        'Market analysis & competitive research',
        'Customer problem validation',
        'Technical architecture planning',
        'Go/No-Go recommendation with pivot options',
        'Detailed validation report'
      ],
      cta: 'Start Validation',
      highlighted: true
    },
    {
      title: 'Build Partnership',
      price: 'Custom',
      duration: '2-12 weeks',
      description: 'Full MVP development with flexible deal structures based on your stage.',
      features: [
        'Idea Stage: 20-40% equity, lower cash',
        'Validated: 5-15% equity, market cash',
        'Funded: 2-5% equity, premium cash',
        '3 months post-launch support',
        'Ongoing partnership through exit'
      ],
      cta: 'Become a Partner',
      highlighted: false
    }
  ];

  return (
    <View style={styles.container}>
      <Text style={styles.sectionTitle}>Partnership Options</Text>
      <Text style={styles.sectionSubtitle}>
        Every founder starts somewhere. Let's find the right fit.
      </Text>

      <View style={styles.servicesGrid}>
        {services.map((service, index) => (
          <View
            key={index}
            style={[
              styles.serviceCard,
              service.highlighted && styles.highlightedCard
            ]}
          >
            {service.highlighted && (
              <View style={styles.popularBadge}>
                <Text style={styles.popularText}>MOST POPULAR</Text>
              </View>
            )}

            <Text style={styles.serviceTitle}>{service.title}</Text>

            <View style={styles.pricingRow}>
              <Text style={styles.price}>{service.price}</Text>
              <Text style={styles.duration}>{service.duration}</Text>
            </View>

            <Text style={styles.description}>{service.description}</Text>

            <View style={styles.featuresContainer}>
              {service.features.map((feature, idx) => (
                <View key={idx} style={styles.featureItem}>
                  <Text style={styles.featureBullet}>â†’</Text>
                  <Text style={styles.featureText}>{feature}</Text>
                </View>
              ))}
            </View>

            <TouchableOpacity
              style={[
                styles.ctaButton,
                service.highlighted && styles.highlightedButton
              ]}
              onPress={handleCTAPress}
              activeOpacity={0.8}
            >
              <Text style={[
                styles.ctaButtonText,
                service.highlighted && styles.highlightedButtonText
              ]}>
                {service.cta}
              </Text>
            </TouchableOpacity>
          </View>
        ))}
      </View>

      <Text style={styles.disclaimer}>
        * Equity partnerships subject to mutual agreement and due diligence
      </Text>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    backgroundColor: '#0A0B0F',
    paddingVertical: 80,
    paddingHorizontal: width > 768 ? 40 : 20,
    borderTopWidth: 1,
    borderTopColor: 'rgba(255, 255, 255, 0.06)',
  },
  sectionTitle: {
    fontFamily: Platform.OS === 'web' ? "'Inter', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 42 : 32,
    fontWeight: '800',
    color: '#F3F4F6',
    textAlign: 'center',
    marginBottom: 20,
    letterSpacing: -1,
  },
  sectionSubtitle: {
    fontFamily: Platform.OS === 'web' ? "'Inter', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 18 : 16,
    color: '#9CA3AF',
    textAlign: 'center',
    marginBottom: 60,
  },
  servicesGrid: {
    flexDirection: width > 1024 ? 'row' : 'column',
    justifyContent: 'center',
    alignItems: width > 1024 ? 'stretch' : 'center',
    gap: 24,
    maxWidth: 1200,
    alignSelf: 'center',
    width: '100%',
  },
  serviceCard: {
    backgroundColor: 'rgba(20, 21, 32, 0.5)',
    borderRadius: 16,
    padding: width > 768 ? 32 : 24,
    borderWidth: 1,
    borderColor: 'rgba(255, 255, 255, 0.06)',
    flex: width > 1024 ? 1 : 0,
    maxWidth: width > 1024 ? 380 : 500,
    width: width > 1024 ? 'auto' : '100%',
    position: 'relative',
    ...Platform.select({
      web: {
        transition: 'all 0.3s ease',
        ':hover': {
          transform: 'translateY(-4px)',
          borderColor: 'rgba(14, 165, 233, 0.3)',
        },
      },
    }),
  },
  highlightedCard: {
    borderColor: 'rgba(14, 165, 233, 0.3)',
    backgroundColor: 'rgba(14, 165, 233, 0.05)',
    transform: width > 1024 ? [{ scale: 1.05 }] : [{ scale: 1 }],
  },
  popularBadge: {
    position: 'absolute',
    top: -12,
    left: '50%',
    transform: [{ translateX: -60 }],
    backgroundColor: '#F59E0B',
    paddingHorizontal: 16,
    paddingVertical: 6,
    borderRadius: 20,
  },
  popularText: {
    fontFamily: Platform.OS === 'web' ? "'Inter', sans-serif" : 'sans-serif',
    fontSize: 11,
    fontWeight: '700',
    color: '#0A0B0F',
    letterSpacing: 1,
  },
  serviceTitle: {
    fontFamily: Platform.OS === 'web' ? "'Inter', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 24 : 20,
    fontWeight: '700',
    color: '#FFFFFF',
    marginBottom: 16,
    textAlign: 'center',
  },
  pricingRow: {
    flexDirection: 'row',
    justifyContent: 'center',
    alignItems: 'baseline',
    gap: 12,
    marginBottom: 20,
  },
  price: {
    fontFamily: Platform.OS === 'web' ? "'Inter', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 32 : 28,
    fontWeight: '800',
    color: '#0EA5E9',
  },
  duration: {
    fontFamily: Platform.OS === 'web' ? "'Inter', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 14 : 13,
    color: '#9CA3AF',
  },
  description: {
    fontFamily: Platform.OS === 'web' ? "'Inter', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 15 : 14,
    color: '#D1D5DB',
    lineHeight: 22,
    marginBottom: 24,
    textAlign: 'center',
    minHeight: 44,
  },
  featuresContainer: {
    marginBottom: 32,
  },
  featureItem: {
    flexDirection: 'row',
    alignItems: 'flex-start',
    marginBottom: 12,
  },
  featureBullet: {
    fontFamily: Platform.OS === 'web' ? "'Inter', sans-serif" : 'sans-serif',
    fontSize: 16,
    color: '#0EA5E9',
    marginRight: 12,
    fontWeight: '700',
  },
  featureText: {
    fontFamily: Platform.OS === 'web' ? "'Inter', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 14 : 13,
    color: '#9CA3AF',
    flex: 1,
    lineHeight: 20,
  },
  ctaButton: {
    backgroundColor: 'transparent',
    paddingVertical: 14,
    paddingHorizontal: 24,
    borderRadius: 8,
    borderWidth: 2,
    borderColor: '#0EA5E9',
    ...Platform.select({
      web: {
        transition: 'all 0.2s ease',
        cursor: 'pointer',
        ':hover': {
          backgroundColor: '#0EA5E9',
        },
      },
    }),
  },
  highlightedButton: {
    backgroundColor: '#0EA5E9',
    borderColor: '#0EA5E9',
  },
  ctaButtonText: {
    fontFamily: Platform.OS === 'web' ? "'Inter', sans-serif" : 'sans-serif',
    fontSize: width > 768 ? 16 : 15,
    color: '#0EA5E9',
    fontWeight: '700',
    textAlign: 'center',
  },
  highlightedButtonText: {
    color: '#FFFFFF',
  },
  disclaimer: {
    fontFamily: Platform.OS === 'web' ? "'Inter', sans-serif" : 'sans-serif',
    fontSize: 12,
    color: '#6B7280',
    textAlign: 'center',
    marginTop: 40,
    fontStyle: 'italic',
  },
});

export default ServicesSection;
